export default function MobilCard({ nama, stok, foto }) {
    return (
        <div>
            <div className="w-96 h-60 rounded-lg bg-black">
                <img className="" src="" alt="" />
            </div>
            <h1 className="font-black text-2xl text-left mt-5">Nama mobil</h1>
            <p className="font-semiold text-xl text-left">Stok: 0</p>
        </div>
    );
}
